import { React } from "react";
import { useSelector } from "react-redux"; 
import "./Dashboard.css";
import Card from "../Card/Card";

import add from "../../assets/add.svg";
                <img src="../assets/3_dot_menu.svg" alt="" />

const Dashboard = () => {
  const isStatus = localStorage.getItem("group") === "status";
  const isPriority = localStorage.getItem("group") === "priority";
  console.log("stat", isStatus, "prio", isPriority);
  const { selectedData, user } = useSelector(
    (state) => state.SelectDataReducer
  );

  return (
    selectedData && (
      <div className="dashContainer">
        {selectedData.map((element, index) => {
          const cardWidthPercentage = 18.7;
          return (
            <div
              key={index}
              className="dashCardContainer"
              style={{ width: `${cardWidthPercentage}%` }}
            >
              <div className="dashCardHeading flex-sb">
                <div className="leftView">
                  {user ? (
                    <div
                      className="imageContainer relative"
                      style={{ width: "10px", height: "15px", display: "inline-block", }}
                    >
                    </div>)
                    :
                    isStatus ? (
                      <div
                        className="cardTitle"
                        style={{ width: "15px", height: "15px", display: "inline-block", fontWeight: 200, }}
                      >
                        {element[index].title === "Backlog" ? (
                          <img src="../assets/Backlog.svg" alt="" />
                        )
                          : element[index].title === "Todo" ? (
                            <img src="../assets/To_do.svg" alt="" />
                          )
                            : element[index].title === "In progress" ? (
                              <img src="../assets/in_progress.svg" alt="" />
                            )
                              : element[index].title === "Done" ? (
                                <img src="../assets/Done.svg" alt="" />
                              )
                                : (
                                  <img src="../assets/Cancelled.svg" alt="" />
                                )}
                      </div>
                    )
                      :
                      isPriority ? (
                        <div className="tags color-grey"
                          style={{
                            width: "35px",
                            height: "30px",
                            display: "inline-block",
                          }}>
                          {
                            element[index].title === "Low" ? (
                              <img src="../assets/Img_Low_Priority.svg" alt="" />
                            ) :
                              element[index].title === "Medium" ? (
                                <img src="../assets/Img_Medium_Priority.svg" alt="" />
                              ) :
                                element[index].title === "High" ? (
                                  <img src="../assets/Img_High_Priority.svg" alt="" />
                                ) :
                                  element[index].title === "Urgent" ? (
                                    <img src="../assets/Urgent_Priority_colour.svg" alt="" />
                                  ) :
                                    (
                                      <img src="../assets/No_priority.svg" alt="" />

                                    )}
                        </div>)
                        :
                        (<img src="../assets/No_priority.svg" alt="" />
                          //still to change
                        )}{" "}
                  <span>
                    {element[index]?.title} {element[index].value?.length}
                  </span>
                </div>
                <div className="rightView">
                  {/* span check */}
                  <img src="../assets/add.svg" alt="" />
                  <img src="../assets/3_dot_menu.svg" alt="" />
                </div>
              </div>
              <div className="dashList flex-gap-10">
                {element[index]?.value?.map((element, ind) => {
                  return (
                    <Card
                      id={element.id}
                      title={element.title}
                      tag={element.tag}
                      status={element.status}
                      priority={element.priority}
                    />
                  );
                })}
              </div>
            </div>
          );
        })}
        {isStatus && (
          <>
            <div className="dashCardHeading flex-sb">
              <div className="leftView" style={{ fontSize: "15px", marginRight: "90px", wordSpacing: "4px" }}>
                <div
                  className="cardTitle"
                  style={{
                    width: "13px",
                    height: "13px",
                    display: "inline-block",
                    fontWeight: 200,
                  }}
                >
                  <img src="../assets/Done.svg" alt="" />
                </div>{" "}
                <span style={{ fontSize: "13px", fontWeight: "lighter" }}>Done</span> <span style={{ fontSize: "13px", color: "#8F9997" }}>0</span>
              </div>
              <div className="rightView">
                <img src="../assets/add.svg" alt="" />
                <img src="../assets/3_dot_menu.svg" alt="" />
              </div>
            </div>
            <div className="dashCardHeading flex-sb">
              <div className="leftView" style={{ fontSize: "15px", marginRight: "60px", wordSpacing: "4px" }}>
                <div
                  className="cardTitle"
                  style={{
                    width: "9px",
                    height: "9px",
                    display: "inline-block",
                    fontWeight: 200,
                  }}
                >
                  <img src="../assets/Cancelled.svg" alt="" />
                </div>{" "}
                <span style={{ fontSize: "13px", fontWeight: "lighter" }}>Cancelled</span> <span style={{ fontSize: "13px", color: "#8F9997" }}>0</span>
              </div>
              <div className="rightView">
                <img src="../assets/add.svg" alt="" />
                <img src="../assets/3_dot_menu.svg" alt="" />
              </div>
            </div>
          </>
        )}
      </div>
    )
  );
};

export default Dashboard;
